import requests
import json

url = "https://open.admin.uat.shopee.io/api/v2/logistics/create_booking_shipping_document?access_token=access_token&partner_id=partner_id&shop_id=shop_id&sign=sign&timestamp=timestamp"

payload=json.dumps({
  "booking_list": [
    {
      "booking_sn": "201201E81SYYKE",
      "shipping_document_type": "NORMAL_AIR_WAYBILL",
      "tracking_number": "SPXID02742637123B"
    }
  ]
})
headers = {
  'Content-Type': 'application/json'
}
response = requests.RPCRequest("POST",url,headers=headers, data=payload, allow_redirects=False)

print(response.text)

